/* VCD dumping functions */
MOD_mkBridge & mkBridge_backing(tSimStateHdl simHdl)
{
  static MOD_mkBridge *instance = NULL;
  if (instance == NULL)
  {
    vcd_set_backing_instance(simHdl, true);
    instance = new MOD_mkBridge(simHdl, "top", NULL);
    vcd_set_backing_instance(simHdl, false);
  }
  return *instance;
}
void MODEL_mkBridge::dump_VCD_defs()
{
  (mkBridge_instance->dump_VCD_defs)(vcd_depth(sim_hdl));
}
void MODEL_mkBridge::dump_VCD(tVCDDumpType dt)
{
  (mkBridge_instance->dump_VCD)(dt, vcd_depth(sim_hdl), mkBridge_backing(sim_hdl));
}
